import React, { useState, useEffect } from "react";
import { plans } from "../../../../constant";
import { Field, reduxForm } from "redux-form";
import { parse } from "query-string";
import { renderFeild } from "../../../../components/inputFeild";

const PlanDetails = ({ prevPage, nextPage }) => {
  const [invest, setinvest] = useState(null);
  const { id } = parse(window.location.search);

  const getInvestmentDetails = () => {
    return plans.find((invest) => setinvest(invest));
  };

  useEffect(() => {
    getInvestmentDetails();
  }, []);

  return (
    <div className="">



      <div>
        <h1 className="text-3xl font-semibold text-black">Plan Details</h1>
        <div className="flex items-center">
          <button className="bg-blue-800 text-white p-2 px-8 inline-flex rounded-lg">
            <svg
              className="w-6 h-6 "
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                stroke-linecap="round"
                stroke-linejoin="round"
                stroke-width="2"
                d="M15 19l-7-7 7-7"
              ></path>
            </svg>
            Prev
          </button>

          <button className="bg-blue-800 text-white p-2 px-8 inline-flex ml-2 rounded-lg">
            Next
            <svg
              class="w-6 h-6"
              stroke="currentColor"
              viewBox="0 0 24 24"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                stroke-linecap="round"
                stroke-linejoin="round"
                stroke-width="2"
                d="M9 5l7 7-7 7"
              ></path>
            </svg>
          </button>
        </div>
      </div>
    </div>
  );
};

export default reduxForm({
  form: "investmentForm",
  destroyOnUnmount: false,
  forceUnregisterOnUnmount: false,
})(PlanDetails);
